import React from 'React';
import {ROWS, COLS, CELL} from './const';


function Cells(){
const cells =[];
for (let row=0;row<ROWS; row++){
	for (let col=0; col<COL;col++){
		cells.push(<div className={'cell'}/>)
	}
}
return (<div 
style={{width:COLS*CELL, height:ROWS*CELL}}
	className='board'>
	{cells}
	</div>)
}

export default Cells;
